Photon.AddCustomHUDIcon = function(name, data)
	if PhotonHUD.DefaultIcons[name] then
		return Error("[Photon] Attempted to overwrite default icon in Photon.AddCustomHUDIcon.")
	end

	PhotonHUD.Icons[name] = data
	PhotonHUD:BuildCode()
	PhotonHUD:Init()
end

