function PhotonHUD:UpdateState()
	local newData = PhotonHUD:GetCurrentState()
	if not newData then PhotonHUD.ShouldDraw = false; return end
	if not PhotonHUD.Data then PhotonHUD.Data = newData; PhotonHUD:Reset( PhotonHUD.Data ) end
	if PhotonHUD.ShouldDraw == false then PhotonHUD.ShouldDraw = true; PhotonHUD:Reset( newData ) return end
	local oldData = PhotonHUD.Data
	if istable( newData.PrimaryLights ) then
		if newData.PrimaryLights.Enabled != oldData.PrimaryLights.Enabled then
			PhotonHUD.Panel:RunJavascript( "photonUI.setPrimary(" .. tostring( newData.PrimaryLights.Enabled ) .. ");" )
		end
		if newData.PrimaryLights.SelectedIndex != oldData.PrimaryLights.SelectedIndex then
			PhotonHUD.Panel:RunJavascript( "photonUI.setActivePrimary(" .. tostring( newData.PrimaryLights.SelectedIndex ) .. ", '" .. tostring( newData.PrimaryLights.Name ) .. "')")
		end
	end
	if istable( newData.AuxLights ) then
		if not oldData.AuxLights then PhotonHUD:Reset( newData ) return end
		if newData.AuxLights.Enabled != oldData.AuxLights.Enabled then
			PhotonHUD.Panel:RunJavascript( "photonUI.setAux(" .. tostring( newData.AuxLights.Enabled ) .. ");" )
		end
		if newData.AuxLights.SelectedIndex != oldData.AuxLights.SelectedIndex then
			PhotonHUD.Panel:RunJavascript( "photonUI.setActiveAux(" .. tostring( newData.AuxLights.SelectedIndex ) .. ", '" .. tostring( newData.AuxLights.Name ) .. "')")
		end
	end
	if istable( newData.Siren ) then
		if not oldData.Siren then PhotonHUD:Reset( newData ) return end
		if oldData.Siren.Name != newData.Siren.Name or oldData.Siren.Category != newData.Siren.Category then PhotonHUD:Reset( newData ); return end
		if oldData.Siren.Enabled != newData.Siren.Enabled or oldData.Siren.Active != newData.Siren.Active then
			local state = 1
			if newData.Siren.Enabled then state = 2 end
			PhotonHUD.Panel:RunJavascript( "photonUI.updateButtonExclusive('siren'," .. newData.Siren.Active .. ", " .. state .. ");" )
		end
	end
	if istable( newData.Illumination ) then
		if not oldData.Illumination then PhotonHUD:Reset( newData ) return end
		if oldData.Illumination.Enabled != newData.Illumination.Enabled or oldData.Illumination.Active != newData.Illumination.Active then
			local state = 1
			if newData.Illumination.Enabled then state = 2 end
			PhotonHUD.Panel:RunJavascript( "photonUI.updateButtonExclusive('illumination'," .. newData.Illumination.Active .. ", " .. state .. ");" )
		end
	end
	if istable( newData.Functions ) then
		for i=1,#oldData.Functions do
			local newButton = newData.Functions[i]
			local oldButton = oldData.Functions[i]
			if newButton.State != oldButton.State then
				PhotonHUD.Panel:RunJavascript( "photonUI.updateButtonExclusive('functions'," .. i .. ", " .. newButton.State .. ");" )
			end
		end
	end
	PhotonHUD.Data = newData
end

function PhotonHUD:Reset( data )
	PhotonHUD:ResetLayout( data.PrimaryLights, data.AuxLights, data.Siren, data.Illumination, data.Functions )
end

function PhotonHUD:GetCurrentState()
	local data = {}
	local ply = LocalPlayer()
	local ent = ply:GetVehicle()
	if not IsValid(ply) or not IsValid(ent) or not ent:Photon() or not ent:IsEMV() or not ent.Photon_Lights then return false end
	data.EMV = ent:IsEMV()
	local name = ent.VehicleName
	if not name then return end
	if data.EMV then
		local primaryLights = EMVU.Sequences[name]["Sequences"]
		if istable(primaryLights) then
			data.PrimaryLights = {}
			data.PrimaryLights.Max = #primaryLights
			data.PrimaryLights.Enabled = ent:Photon_Lights()
			data.PrimaryLights.SelectedIndex = ent:Photon_LightOption()
			data.PrimaryLights.Name = ent:Photon_ELS_GetSequenceName()
		end
		local auxLights = EMVU.Sequences[name]["Traffic"]
		if istable( auxLights ) then
			data.AuxLights = {}
			data.AuxLights.Max = #auxLights
			data.AuxLights.Enabled = ent:Photon_TrafficAdvisor()
			data.AuxLights.SelectedIndex = ent:Photon_TrafficAdvisorOption()
			data.AuxLights.Name = tostring( EMVU.Helper:GetTrafficAdvisorName( name, ent:Photon_TrafficAdvisorOption() ) )
		end
		if not ent:Photon_NoSiren() then
			local activeSiren = ent:Photon_SirenOption()
			local sirenOption = ent:Photon_SirenSet()
			local sirenOn = ent:Photon_Siren()
			data.Siren = {}
			data.Siren.Name = EMVU.GetSirenTable()[sirenOption]["Name"] or "Unknown"
			data.Siren.Model = EMVU.GetSirenTable()[sirenOption]["Category"] or "Unknown"
			data.Siren.Active = activeSiren
			data.Siren.Enabled = sirenOn
			data.Siren.SirenTable = {}
			for i=1,#EMVU.GetSirenTable()[sirenOption]["Set"] do
				local useState = 0
				if activeSiren == i then
					useState = 1
					if sirenOn then
						useState = 2
					end
				end
				local siren = EMVU.GetSirenTable()[sirenOption]["Set"][i]
				data.Siren.SirenTable[i] = {
					Name = siren.Name,
					Icon = siren.Icon or "wail",
					State = useState
				}
			end

			data.Functions = {}
			local useState = 0
			if ent:Photon_ManualSiren() then useState = 2 else useState = 0 end
			data.Functions[1] = {
				Name = "Man",
				Icon = "manual",
				State = useState
			}
			if ent:Photon_ManualHorn() then useState = 2 else useState = 0 end
			data.Functions[2] = {
				Name = "Horn",
				Icon = "horn",
				State = useState
			}
			if not (ent.Photon_IsRunning and ent:Photon_IsRunning()) then useState = 2 else useState = 0 end
			data.Functions[3] = {
				Name = "",
				Icon = "blackout",
				State = useState
			}
		end
		if ent:Photon_HasIllum() then
			local activeOption = ent:Photon_IllumOption()
			local isOn = ent:Photon_Illumination()
			data.Illumination = {}
			data.Illumination.Active = activeOption
			data.Illumination.Enabled = isOn
			data.Illumination.LightTable = {}
			for i=1,#EMVU.Sequences[name]["Illumination"] do
				local useState = 0
				if activeOption == i then
					useState = 1
					if isOn then
						useState = 2
					end
				end
				local illum = EMVU.Sequences[name]["Illumination"][i]
				data.Illumination.LightTable[i] = {
					Name = illum.Name,
					Icon = illum.Icon or false,
					State = useState
				}
			end
		end
	end
	return data
end

function PhotonHUD:ResetLayout( primary, auxiliary, sirens, illum, funcs )
	if not PhotonHUD.Panel then return end
	PhotonHUD.Panel:RunJavascript( "photonUI.resetLayout();" )
	if istable( primary ) then
		local max = primary.Max
		local index = primary.SelectedIndex
		local name = primary.Name
		local enabled = primary.Enabled
		PhotonHUD.Panel:RunJavascript( "photonUI.setupPrimaryLights(" .. tostring( max ) .. ", " .. tostring( index ) .. ", '" .. tostring( name ) .. "', " .. tostring( enabled ) ..");" )
	end
	if istable( auxiliary ) then
		local max = auxiliary.Max
		local index = auxiliary.SelectedIndex
		local name = auxiliary.Name
		local enabled = auxiliary.Enabled
		PhotonHUD.Panel:RunJavascript( "photonUI.setupAuxLights(" .. tostring( max ) .. ", " .. tostring( index ) .. ", '" .. tostring( name ) .. "', " .. tostring( enabled ) ..");" )
	end
	if istable( sirens ) then
		local sirenTable = sirens.SirenTable
		PhotonHUD.Panel:RunJavascript( "photonUI.addSection('siren');" )
		PhotonHUD.Panel:RunJavascript( "photonUI.updateSirenModel('" .. tostring( sirens.Model ) .. "', '" .. tostring( sirens.Name ) .. "');" )
		for i=1,#sirenTable do
			local siren = sirenTable[i]
			PhotonHUD.Panel:RunJavascript( "photonUI.addButton('siren', '" .. siren.Icon .. "', '" .. siren.Name .. "', " .. i .. ", " .. siren.State ..");" )
		end
	else
		PhotonHUD.Panel:RunJavascript( "photonUI.updateSirenModel('', '');" )
	end
	if istable( illum ) then
		local illumTable = illum.LightTable
		PhotonHUD.Panel:RunJavascript( "photonUI.addSection('illumination');" )
		for i=1,#illumTable do
			local light = illumTable[i]
			if not light.Icon then
				local tryName = PhotonHUD:TranslateLegacyIllum( tostring( light.Name ) )
				local tryIcon = PhotonHUD:GetIllumIcon( tryName )
				light.Name = tryName
				light.Icon = tryIcon
			end
			PhotonHUD.Panel:RunJavascript( "photonUI.addButton('illumination', '" .. tostring(light.Icon) .. "', '" .. light.Name .. "', " .. i .. ", " .. light.State ..");" )
		end
	end
	if istable( funcs ) then
		PhotonHUD.Panel:RunJavascript( "photonUI.addSection('functions');" )
		for i=1,#funcs do
			local func = funcs[i]
			PhotonHUD.Panel:RunJavascript( "photonUI.addButton('functions', '" .. func.Icon .. "', '" .. func.Name .. "', " .. i .. ", " .. func.State ..");" )
		end
	end
end



local function PhotonHtml()
	if not PhotonHUD.Panel then return end
	PhotonHUD:AutoUpdate()
	if not PhotonHUD.ShouldDraw then return end
	if drawTexture != false then
		local opacity = 255 * HUD_OPACITY:GetFloat()
		setDrawColor( 255, 255, 255, opacity )
		setMaterial( drawTexture )
		drawTexturedRect( scrW - 512, scrH - 512, 512, 512 )
	end
end
hook.Add( "HUDPaint", "Photon.NewHUDPaint", function()
	PhotonHtml()
end)

if PhotonHUD then PhotonHUD:Init() end




